import React from 'react'

export const Boxcontrol = () => {
  return (
    <div className='row'>
        <div className="box bg-danger col-lg-3 col-md-6 col-sm-12">
          <div className="Box1"></div>
          <div className="littleBox1"></div>
        </div>
    </div>
  )
}
